Vamos falar de impacto! A Amil, parte da família de empresas do UnitedHealth Group, conta com uma equipe de profissionais de alto nível trabalhando em conjunto para ajudar as pessoas a viverem vidas mais saudáveis. A empresa oferece uma ampla variedade de planos de assistência médico-hospitalar e odontológica que proporcionam, aos seus mais de 5,9 milhões de beneficiários, acesso a serviços de alta qualidade. A Amil também possui uma extensa rede credenciada no país, que abrange cerca de 31,8 mil serviços de saúde, entre hospitais, consultórios, clínicas médicas, laboratórios e centros de diagnóstico por imagem. Se você busca maior impacto e mais desafio, a Amil é o lugar certo. É a oportunidade para realizar o melhor trabalho de sua vida. SM
,
,Responsabilidades:,
Atuar em todos os processos da área de suprimentos;
,
Participação na elaboração de estratégia de categoria, negociações (contratos e spot);
,
Atendimento ao cliente interno e fornecedores;
,
Acompanhamento da execução de contatro de fornecimento;
,
Propecção, qualificação e desenvolvimento de novos fornecedores.
,
,Qualificações Necessárias:,
Experiência em compras de medicamentos e materiais médicos;
,
Ampla experiência na área de Compras/Suprimentos;
,
Ampla experiência em compras de grande volume com grande quantiedade de SKUs;
,
Experiência em Negociação de contratos e compras spot;
,
Experiência em qualificação e desenvolvimento de fornecedores;
,
Experiência com sistemas/ferramentas de negociação e cotação;
,
Análise de contratos;
,
Formação superior completa em Engenharia e/ou Administração ou áreas afins;
,
Inglês nível avançado.
,
,Qualificações Desejáveis:,
Pós graduação/MBA na área;
,
Experiência com o sistema de cotação Mercado Eletrônico.

