Na Optum, uma empresa do United Health Group, a expansão do acesso a um cuidado de saúde de custo acessível e de alta qualidade, começa aqui. A maioria das ideias mais inovadoras de cuidado de saúde é criada diariamente aqui. É aqui onde as pessoas ousadas com grandes ideias estão escrevendo o próximo capítulo na área da saúde. Aqui é o lugar para você fazer o melhor trabalho da sua vida.(sm)
,
,Responsabilidades:,
O especialista terá responsabilidades como focal técnico da equipe, ao qual irá pensar, agir e propor soluções técnicas na área de testes, além das seguintes atividades:
,
Analizar os requisitos do sistema e as especificações técnicas para criar e executar o planos e casos de testes de ponta a ponta juntamente com gerenciamento de defeitos;
,
Auxiliar os usuários na definição dos testes de aceitação, planos e casos de testes;
,
Participar das reuniões de grupo de inspeção, grupo de usuários e de revisão;
,
Trabalhar com usuários, analistas de sistemas, designers e programadores para criar e analisar os documentos requeridos pelo projeto;
,
Participar na verificação da implementação da produção e ser responsável por validar a qualidade do sistema;
,
Planejar, documentar, avaliar e rastrear os resultados dos testes para garantir que as aplicações do sistema estejam livres de defeitos;
,
Comunicar e interagir com áreas apropriadas em problemas e mudanças que podem impactar dados, fluxo de trabalho e/ou funcionalidade no software;
,
Estudar e analisar documentos de especificações de software para desenvolver cenários de teste;
,
Criar casos e testes de dados com suporte de planos de testes;
,
Além de outras atividades inerentes ao cargo
,
,Qualificações Preferidas:,
Grande experiência no mundo de testes;
,
Grande conhecimento nas principais ferramentas de testes do mercado;
,
Vivência como focal point de projetos/processos;
,
Graduação completa nas áreas de TI;
,
Conhecimento na metodologia Agile e UML
,
A diversidade cria ambientes mais saudáveis. Todos os candidatos qualificados serão considerados para as vagas, sem distinção de raça, cor, religião, gênero, idade, nacionalidade ou deficiência. O UnitedHealth Group é um empregador de Igualdade de Oportunidades de Emprego.
,
,palavras-chave:, e specialista de testes etl, linux, uml, ti, , tecnologia da informação,BI, SQL; PLSQL, Microstrategy, SSIS, SSAS and SSRS, ALM, Testes, SDLC, STLC, Curitiba, PR

